import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
// import "./style.css";
import MainHeader from "../Home/MainHeader";
import jobpic from '../../images/jobbank.jpg'


export default class JobBank extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="container-fluid bg-light">

<MainHeader />
      <div style={{backgroundImage:`url(${jobpic})`}} className='back'>
        <div style={{backgroundColor:'rgba(0,0,0,.5)'}} className='p-5'>
          <h1 className='p-3 text-white'>Job Bank</h1>
        </div>
      </div>

</div>
    );
  }
}
